                    <img className='leftPicture' src='./images/passwordPicture.jpg' alt='passwordPicture.jpg'/>
                </div>
                <div className='right'>
                    <h4 className='title'>忘记密码</h4>
                    <hr className='line'/>
                    <AlterPwd style={{width:"100%"}}/>
                </div>
            </div>

        );
    }
}

export default ForgetPwd;
